import React from "react";
import "../styles/Home.css";
import Circle from "./Circle";
import Header from "./Header";
import NavBar from "./NavBar";

function Home() {
  return (
    <div className="home-container">
      <div className="catalog">
      <NavBar />
        <Header />
        <Circle />
      </div>
    </div>
  );
}

export default Home;
